// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

/**
 * VERY BAD TOKEN – демонстрация Integer Overflow / Underflow.
 * В версии 0.6 арифметика «оборачивается» (wraps around), поэтому
 * 0 - 1 == 2⁵²⁶ – 1  и  (MAX + 1) == 0.
 */
contract OverflowToken {
    string  public constant name     = "VeryBadToken";
    string  public constant symbol   = "VBT";
    uint8   public constant decimals = 18;

    uint256 public totalSupply;
    mapping(address => uint256) public balanceOf;

    constructor() public {
        totalSupply = 1_000 * (10 ** uint256(decimals));
        balanceOf[msg.sender] = totalSupply;      // создателю 1000 VBT
    }

    /**
     * УЯЗВИМО: нет проверки, что у msg.sender хватает токенов!
     * Sub-/add выполняются в unchecked-режиме ⇒ возможны
     * переполнение и underflow.
     */
    function transfer(address _to, uint256 _value) public returns (bool) {
        balanceOf[msg.sender] -= _value;   // <-- underflow
        balanceOf[_to]        += _value;   // <-- overflow
        return true;
    }
}
